import 'antd/dist/antd.css';
import './index.css';
import { Image, Button, Space, Avatar, Descriptions, Row, Col, Tooltip } from 'antd';
import { SyncOutlined } from '@ant-design/icons';

import GoogleMapReact from 'google-map-react';
import styled from 'styled-components';
import Marker from './components/Marker';
import LOS_ANGELES_CENTER from './const/default_center';

import React, { useEffect, useState } from 'react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;

const Wrapper = styled.main`
  width: 100%;
  height: 100%;
`;

const GetUserData = () => {
    const [data, setData] = useState([]);
    const [user, setUser] = useState([]);
    const [places, setPlaces] = useState([])
    const [loadingData, setLoadingData] = useState(false);

    useEffect(() => {
        fetchdata();
    }, []);


    const fetchdata = async () => {
        const response = await fetch("https://randomuser.me/api");
        const data = await response.json();
        console.log(data.results[0]);
        setData(data.results[0]);
        setLoadingData(true);
        title(data);
    };

    function title(title) {
        document.title = title.results[0].name.first;
    }

    const mapStyles = {
        width: '100%',
        height: '100%'
    };

    const imageStyles = {
        marginLeft: '200px'
    };

    // if (!places || places.length === 0) {
    //     return null;
    // }

    return (
        <div>
        {loadingData ? (
                <Row gutter={[20, 20]}>
                    <Col span={12}>
                        <div className="refreshBtn">
                            <Tooltip title="refresh">
                                <Button sixe="large" type="primary" onClick={() => fetchdata()} shape="circle" icon={<SyncOutlined />} />
                            </Tooltip>
                        </div>
                        <div style={imageStyles}><Avatar size={250} src={<Image src={data.picture.large}  style={{ width: 300 }} />} /></div>
                        <div>
                        <Descriptions
                            title={data.name.first  + " Details"}
                            bordered
                            column={{ xxl: 1, xl: 1, lg: 1, md: 1, sm: 1, xs: 1 }}
                            >
                            <Descriptions.Item label="User Name">{data.name.title}. {data.name.first} {data.name.last}</Descriptions.Item>
                            <Descriptions.Item label="Gender">{data.gender}</Descriptions.Item>
                            <Descriptions.Item label="DOB">{data.dob.date}</Descriptions.Item>
                            <Descriptions.Item label="Contact">{data.cell}</Descriptions.Item>
                            <Descriptions.Item label="Email"><a href={"mailto:" + data.email}>{data.email}</a></Descriptions.Item>
                            <Descriptions.Item label="Age">{data.dob.age}</Descriptions.Item>
                            <Descriptions.Item label="Address">
                                {data.location.street.name}, {data.location.street.number}
                                <br />
                                {data.location.state}, {data.location.city}
                                <br />
                                {data.location.country} ({data.nat}), {data.location.postalcode}
                            </Descriptions.Item>
                            <Descriptions.Item label="Registration">
                                {data.registered.date}
                            </Descriptions.Item>
                            </Descriptions>
                        </div>
                    </Col>
                    <Col span={12}>
                    <div style={{ height: '100vh', width: '100%' }}>
                        <Wrapper>
                        <GoogleMapReact
                            defaultZoom={10}
                            defaultCenter={LOS_ANGELES_CENTER}
                        >
                            {places.map((place) => (
                            <Marker
                                key={place.id}
                                text={place.name}
                                lat={place.geometry.location.lat}
                                lng={place.geometry.location.lng}
                            />
                            ))}
                        </GoogleMapReact>
                        </Wrapper>
                    </div>
                    </Col>
                </Row>
        ) : (
          <p>No data</p>
        )}
      </div>
    );
};

export default GetUserData;
